import { Link } from "@remix-run/react";
import {
  QueryClient,
  QueryClientProvider,
  useQuery,
} from "@tanstack/react-query";
import { Email } from "database";
import { formatDistanceToNow } from "date-fns";
import { InboxIcon, MailIcon, RefreshIcon } from "icons";

const queryClient = new QueryClient();

export function MailItem({ mail: item }: { mail: Email }) {
  return (
    <Link
      to={`/mails/${item.id}`}
      key={item.id}
      className={
        "flex flex-col items-start gap-2 rounded-lg border p-3 text-left text-sm transition-all hover:bg-accent space-y-6"
      }
    >
      <div className="flex w-full flex-col gap-1">
        <div className="flex items-center">
          <div className="flex items-center gap-2">
            <div className="font-semibold">{item.from.name}</div>
          </div>
          <div className={"ml-auto text-xs"}>
            {formatDistanceToNow(new Date(item.date || item.createdAt), {
              addSuffix: true,
            })}
          </div>
        </div>
        <div className="text-xs font-medium">{item.subject}</div>
      </div>
      <div className="line-clamp-2 text-xs text-muted-foreground break-all">
        {item.text || item.html || "".substring(0, 300)}
      </div>
    </Link>
  );
}

async function fetchMails() {
  try {
    const resp = await fetch("/api/mails");
    return await resp.json();
  } catch (e) {
    return [];
  }
}

